import { useState } from 'react';
import './App.css';

const gifts = ['car', 'mmoney', 'pc' ];
function App() {

  const [state, stateGift] = useState();

  const handleGift = (gift) => {
    const state =  stateGift[gifts[Math.random()*gifts.length()]];
    return state;
  };

  return (
    <div className="App" style={{padding: 20}}>
      <h1>{gifts || 'Not yet'}</h1>
      <button onClick={handleGift}>Get</button>
    </div>
  );
}

export default App;
